string decodeString(string& input) {
	int i = 0;
    while(i < input.length() && !isdigit(input[i])) {
    	i++;
    }
    // 一串字符串直接返回
    if(i == input.length()) return input;
    // 字符串 + 数字[数字[]/字符串] + 数字[]/字符串
    else {
        // 不属于数字的前半部分
        string pre = input.substr(0, i);
        
        string ans = pre;
        
        int cnt = 0;
        // 识别数字
        while(i < input.length() && isdigit(input[i])) {
            cnt = cnt * 10 + input[i] - '0';
            i++;
        }
        int st = i, ed = i + 1;
        int m = 0;  // 记录中间的左括号
        string mid; // 中间的字符串
        while(ed < input.length()) {
            if(input[ed] == ']') {
                if(m == 0) {
                    mid = input.substr(st + 1, ed - st - 1);
                    break;
                }
                m--;
            } else if(input[ed] == '[') {
                m++;
            }
            ed++;
        }
        string back = input.substr(ed + 1);
        mid = decodeString(mid);
        while(cnt--) ans += mid;
    	return ans + decodeString(back);
    }
} 

