#include<iostream>
#include<vector>
#include<queue>
#include<time.h>
#include<stdlib.h>
using namespace std;
// 存储五子棋棋子(x, y)
typedef pair<int, int> PII;
// 棋盘大小
const int rows = 17, cols = 17;
// 代表上、右上、右、右下、下、左下、左、左上八个方向的方向向量
int dx[] = {-1, -1, 0, 1, 1, 1, 0, -1}, dy[] = {0, 1, 1, 1, 0, -1, -1, -1};
// 棋盘(值为0表示可下，1表示我方棋子，2表示敌方棋子)
int g[rows][cols] = {0};
// 分别代表我方和敌方棋子个数
int as, bs;
// 分别代表我方和敌方棋子
vector<PII> a, b;

// 由你来编写
// 返回PII类型的棋子坐标
PII next() {
    // 示例：
    // 策略：找出我方最长连线棋子，为了预防超时，当有两个位置可以下则找这两个位置中最长连线直接下子
    // 通过大根堆来存储我可以下的位置和对应的棋子个数，键为棋子个数，值为ps数组下标对应的棋子坐标
    priority_queue<PII, vector<PII>, less<PII> > heap;
    // 我方可下的位置
    vector<PII> ps;
    // 遍历棋盘
    for(int i = 1; i < rows - 1; i++) {
        for(int j = 1; j < cols - 1; j++) {
            // 若(i, j)是我方棋子
            if(g[i][j] == 1) {
                // 遍历8个方向
                for(int k = 0; k < 8; k++) {
                    int x = i + dx[k], y = j + dy[k];
                    int cnt = 0;
                    // 统计方向k有多少个连续的我方棋子
                    while(x >= 1 && x < rows - 1 && y >= 1 && y < cols - 1 && g[x][y] == 1) {
                        cnt++;
                        x += dx[k], y += dx[k];
                    }
                    // 若另一边没有下，则将对应的棋子个数和棋子坐标存储
                    if(g[x][y] == 0) {
                        heap.push({cnt, ps.size()});
                        ps.push_back({x, y});
                    }
                    // 防止复杂度太高，出现本回合无操作情况，当有2个位置可以下子时，则直接操作
                    if(heap.size() >= 2) {
                        int t = heap.top().second;
                        return ps[t];
                    }
                }
            }
        }
    }
    // 若无地可下，则随机坐标下棋
    if(heap.empty()) {
        srand((unsigned)time(NULL));
        int a = (rand() % (rows - 1 - 1 + 1)) + 1, b = (rand() % (cols - 1 - 1 + 1)) + 1;
        while(g[a][b] != 0) {
            a = (rand() % (rows - 1 - 1 + 1)) + 1, b = (rand() % (cols - 1 - 1 + 1)) + 1;
        }
        return {a, b};
    } else {
        // 下最多连续棋子的地方
        int t = heap.top().second;
        return ps[t];
    }
}

